const longestBeautifulSubstring = (word) =>{
    let vowels = ['a','e','i','o','u'];
    let s = new Set();
    let result =0;
    let j =0;
    let i = word.indexOf('a');
    let l = i;
    for( i = word.indexOf('a');i<word.length; i++){
        if(word[i] == vowels[j]){
            s.add(word[i]);
        }
        else if(word[i] == vowels[j+1]){
            s.add(word[i]);
            j++;
        }
        else{       
            if(s.size == 5)
                result = Math.max(result, i-l);
            
            if(firsta(word.slice(i))== -1)
                return result;
            i += firsta(word.slice(i))-1;
            l = i+1;           
            j=0;
            s.clear();
        }

               
        if(s.size == 5)
            result = Math.max(result, i-l+1);

    }
    return result;
}

const firsta = (word) => {
    return word.indexOf("a");
}


